                    .swiper{
                        width: 100%; height: 50vh;
                        margin-top: 150px;

                        .content-detail{
                            display: flex;

                            .video-detail{
                                width: 620px; height: 90%; margin-right: 10px;
                                border-radius: 10px;
                                overflow: hidden;

                                video{object-fit: cover; width: 100%; height: 100%;}
                            }

                            .detail-desc{
                                width: 620px; padding: 20px;

                                .code-viewer{
                                    background-color: $color1; color: $color4;
                                    display: block; width: 80px; text-align: center;
                                    padding: 5px; border-radius: 5px;
                                    margin-top: 20px; cursor: pointer;
                                    transition: 0.1s;
                                    &:hover{background-color: $color4; color: $color1;}
                                }
                            }

                            .swiper-pagination-bullet span{width: 12px; height: 12px;}
                            
                        }
                    }
                }
            }
        }
    }

    .contact{
        color: white;

        .contact-me{

            width: 100%; height: 100vh;
            display: flex; justify-content: center;
            align-items: center;

            .contact-box{
                width: 50%;
                position: relative;


                .title{
                    display: flex; justify-content: space-between;
                    margin-bottom: 30px;

                    h1{color: $color4;}

                }
                .which-contact{
                    display: flex; justify-content: space-evenly;
                    a{
                        display: block;
                        cursor: pointer;
                        color: $color4;
                        &:hover{color: white;}
                        text-align: center;
                        text-decoration: none;
                        .fa-phone, .fa-envelope, .fa-instagram{font-size: 60px; padding: 10px;}
                    }
                }
